import React from 'react';
import { connect } from 'react-redux';
import * as actions from '../../Redux/Actions/actions.js';
import StyleChange from '../../Functions/ChangeStyles.js';

class ManagementPage extends React.PureComponent {
  render() {
    return (
      <nav className="navigationBar">
        <ul>
          <li>
            <button
              className="managementMenuButton"
              id="stuffPage"
              onClick={(e) => {
                this.props.getStaff();
                StyleChange(e.target.id);
              }}
            >
              Stuff
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="clientsPage"
              onClick={(e) => {
                this.props.getClients();
                StyleChange(e.target.id);
              }}
            >
              Clients
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="servicesPage"
              onClick={(e) => {
                this.props.getServices();
                StyleChange(e.target.id);
              }}
            >
              Services
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="materialsPage"
              onClick={(e) => {
                this.props.getMaterials();
                StyleChange(e.target.id);
              }}
            >
              Materials
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="ordersPage"
              onClick={(e) => {
                this.props.getOrders();
                StyleChange(e.target.id);
              }}
            >
              Orders
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="schedulesPage"
              onClick={(e) => {
                this.props.getSchedules();
                StyleChange(e.target.id);
              }}
            >
              Schedules
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="promoPage"
              onClick={(e) => {
                this.props.getPromos();
                StyleChange(e.target.id);
              }}
            >
              Promo
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="profilesPage"
              onClick={(e) => {
                this.props.getProfiles();
                StyleChange(e.target.id);
              }}
            >
              Profiles
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="galleryPage"
              onClick={(e) => {
                this.props.getgallery();
                StyleChange(e.target.id);
              }}
            >
              Gallery
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="feedbacksPage"
              onClick={() => {
                this.props.getFeedbacks();
              }}
            >
              Feedbacks
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="filePage"
              onClick={() => {
                this.props.getFiles();
              }}
            >
              MediaFiles
            </button>
          </li>
        </ul>
      </nav>
    );
  }
}

function mapStateToProps(state) {
  return {};
}

function mapDispatchToProps(dispatch) {
  return {
    getClients: () => dispatch(actions.ClientsFeetchData()),
    getStaff: () => dispatch(actions.StaffsFeetchData()),
    getMaterials: () => dispatch(actions.MaterialsFeetchData()),
    getServices: () => dispatch(actions.ServicesFeetchData()),
    getOrders: () => dispatch(actions.OrdersFeetchData()),
    getSchedules: () => dispatch(actions.SchedulesFeetchData()),
    getPromos: () => dispatch(actions.PromosFeetchData()),
    getProfiles: () => dispatch(actions.ProfilesFeetchData()),
    getFeedbacks: () => dispatch(actions.FeedbacksFeetchData()),
    getGallery: () => dispatch(actions.MediaFilesFeetchData()),
    getFiles: () => dispatch(actions.MediaFilesFeetchData()),
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(ManagementPage);
